  \"Distributed, Passivity-Based, Aeroservoelastic Control (DPASC) of Structurally
  Efficient Aircraft in the Presence of Gusts Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:12:28.694959\",\n\t\"name\": \"distributed-passivity-based-aeroservoelastic-control-dpasc-of-structurally-efficient-aircr\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Control of extremely lightweight, long endurance
  aircraft poses a challenging aeroservoelastic (ASE) problem due to significantly
  increased flexibility, and aerodynamic, structural, and actuator nonlinearities.
  To obtain the benefits of increased aerostructural efficiency, the controller needs
  to trim at a specified optimal shape while minimizing structural fatigue from gust
  disturbances. Tao Systems and Texas A&amp;M University propose to develop a distributed,
  passivity-based, ASE controller (DPASC) using sectional aerodynamic and structural
  output-only feedback. This scalable, decentralized approach has the potential to
  minimize the impact of aerodynamic / structural uncertainties and control surface
  free-play / saturation, while guaranteeing global asymptotic stability.\",\n\t\"license_title\":
